import React from "react";
import "./style.css";
import ListItem from "./components/ListItem";
import Logo from "assets/logoShopl.png";

function App() {
  return (
    <div className="App">
      <img src={Logo} alt="Shopl Logo"></img>
      <ListItem />
      <ListItem />
    </div>
  );
}

export default App;
